import React, {useEffect} from 'react';
import Select from "react-select";

const SelectComponent = ({optionData,updateLink}) => {
    var options = [{
        value: "Select",
        label: "Select"
    }]

    useEffect(()=>{
        optionData.map((data)=>{
            options.push({
                value: data.map_link,
                label: data.language
            })
        })
    })

  return (
    <Select onChange={(e)=>{updateLink()}} options={options} />
  )
}

export default SelectComponent
